import React, { useContext } from 'react'
import Cart from '../../cartholder/Cart'

const CartCard = () => {
  const cartobjects = useContext(Cart)
  return
  <div className='cart__card'>
    {cartobjects.cart.map((item) => {
       return (
         <div className='cart__item'>
           <p>
             {item.itemname}
           </p>
         </div>
       )
     })}
  </div>
}
export default CartCard
